import Cnt from "./.components/cnt"
import inputText from "./.components/inputText"

function App() {

  return (
    <div className="App">
        <Cnt/>
        <hr/>

        <Cnt/>
        <hr/>

        <inputText/>
    </div>
  );
}

export default App;
